description:
The Origins of Football

History Documentary hosted by Luis Ignacio Gonzales, published by Wanda Films &amp; Volcan Producciones in 2013 - English narration


Information
------------------------------

&quot;The Origins of football&quot; tells the story of football from its remotest origins. The documentary is a faithful reflection of the evolution of this sport, from its beginnings until it became the greatest spectacle in the world. The film is based on the wealth of archaeological evidence which clearly shows that games similar to present-day football have been played since the third century before Christ. The most representative games that could be regarded as ancestors of football and that have been played through the course of history in very different culturesN

